$(document).ready(function(){$("body").on("fileActionEvent",function(b,c){if(c.obj.hasClass("scv")){var a=ToolBox.getSelectedFiles(c.obj);ToolBox.getDialogByPost({action:"scv",files:a},function(e){if(!e.error){var f=$(e);var d=$(window).height();var g=$(window).width();$(".prettyprint",f).data("src",$(".prettyprint",f).text());$(".prettyprint",f).css({"max-width":(g-120)+"px","max-height":(d-300)+"px"});$(".scv-linenum",f).button().click(function(h){$.MyPreventDefault(h);$(".prettyprint",f).toggleClass("linenums").removeClass("prettyprinted").text($(".prettyprint",f).data("src"));prettyPrint();return false});f.dialog({width:"auto",height:"auto",maxWidth:g-50,maxHeight:d-50,dialogClass:"scv",closeText:$("#close").html(),open:function(){if(prettyPrint){prettyPrint()}f.MyTooltip(500)}})}})}})});